import React from 'react';
import { makeStyles } from '@material-ui/core/styles';
import TableSortLabel from '@material-ui/core/TableSortLabel';
import TableHead from '@material-ui/core/TableHead';
import TableRow from '@material-ui/core/TableRow';
import TableCell from '@material-ui/core/TableCell';

const headCells = [
    { id: 'flag', numeric: false, isSortable: false, label: '' },
    { id: 'name', numeric: false, isSortable: true, label: 'Calories' },
    { id: 'population', numeric: true, isSortable: true, label: 'Fat (g)' },
    { id: 'region', numeric: false, isSortable: true, label: 'Carbs (g)' },
    { id: 'languages', numeric: false, isSortable: false, label: 'Protein (g)' },
];

const useStyles = makeStyles({

});

function CountryTableHead({ order, setOrder, orderBy, setOrderBy }) {
    const classes = useStyles();

    return (
        <TableHead className={classes.header}>
            <TableRow>
                {headCells.map(cell => (
                    <TableCell
                        key={cell.id}
                        align="center">
                        {cell.isSortable &&
                            <TableSortLabel
                                active={orderBy === cell.id}
                                direction={orderBy === cell.id ? order : order}>
                                {cell.label}
                                {orderBy === cell.id ? (
                                    <span className={classes.visuallyHidden}>
                                        {order === 'desc' ? 'sorted descending' : 'sorted ascending'}
                                    </span>
                                ) : null}
                            </TableSortLabel>}
                    </TableCell>
                ))}
            </TableRow>
        </TableHead>
    )
}

export default CountryTableHead;
